public DataTable ConvertToDataTable(List<MyObject> list)\n{\n    DataTable dataTable = new DataTable();\n\n    dataTable.Columns.Add("Property1");\n    dataTable.Columns.Add("Property2");\n    dataTable.Columns.Add("Property3");\n    dataTable.Columns.Add("Property4");\n    dataTable.Columns.Add("Property5");\n    dataTable.Columns.Add("Property6");\n    dataTable.Columns.Add("Property7");\n    dataTable.Columns.Add("Property8");\n    dataTable.Columns.Add("Property9");\n\n    foreach (var item in list)\n    {\n        DataRow row = dataTable.NewRow();\n        row["Property1"] = item.Property1;\n        row["Property2"] = item.Property2;\n        row["Property3"] = item.Property3;\n        row["Property4"] = item.Property4;\n        row["Property5"] = item.Property5;\n        row["Property6"] = item.Property6;\n        row["Property7"] = item.Property7;\n        row["Property8"] = item.Property8;\n        row["Property9"] = item.Property9;\n        dataTable.Rows.Add(row);\n    }\n\n    return dataTable;\n}